CREATE TABLE [TipoEstablecimientos] (
    [Id] nvarchar(64) NOT NULL,
    [InsertedAt] datetime2 NULL,
    [InsertedBy] nvarchar(128) NULL,
    [UpdatedAt] datetime2 NULL,
    [UpdatedBy] nvarchar(128) NULL,
    [DeletedAt] datetime2 NULL,
    [DeletedBy] nvarchar(128) NULL,
    [IsDeleted] bit NOT NULL,
    [Nombre] nvarchar(120) NOT NULL,
    [Descripcion] nvarchar(500) NULL,
    CONSTRAINT [PK_TipoEstablecimientos] PRIMARY KEY ([Id])
);

GO

CREATE TABLE [Establecimientos] (
    [Id] nvarchar(64) NOT NULL,
    [InsertedAt] datetime2 NULL,
    [InsertedBy] nvarchar(128) NULL,
    [UpdatedAt] datetime2 NULL,
    [UpdatedBy] nvarchar(128) NULL,
    [DeletedAt] datetime2 NULL,
    [DeletedBy] nvarchar(128) NULL,
    [IsDeleted] bit NOT NULL,
    [Codigo] nvarchar(50) NULL,
    [Nombre] nvarchar(128) NOT NULL,
    [Domicilio] nvarchar(500) NULL,
    [TipoEstablecimientoId] nvarchar(64) NULL,
    [ZonaId] nvarchar(64) NULL,
    [Latitud] decimal(19,10) NULL,
    [Longitud] decimal(19,10) NULL,
    CONSTRAINT [PK_Establecimientos] PRIMARY KEY ([Id]),
    CONSTRAINT [FK_Establecimientos_TipoEstablecimientos_TipoEstablecimientoId] FOREIGN KEY ([TipoEstablecimientoId]) REFERENCES [TipoEstablecimientos] ([Id]) ON DELETE NO ACTION,
    CONSTRAINT [FK_Establecimientos_Zonas_ZonaId] FOREIGN KEY ([ZonaId]) REFERENCES [Zonas] ([Id]) ON DELETE NO ACTION
);

